import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import { HashRouter as Router, Route } from 'react-router-dom';
import Navbar from './Components/General/NavBar/NavBar.js'
import SearchBar from './Components/General/Searchbar/Searchbar.js'
import RadarProfile from './Scenes/Radar/RadarProfile.js'
import Info from './Scenes/Info/Info.js'
import App from './Scenes/Home/App.js'
import * as serviceWorker from './serviceWorker';

class MyApp extends React.PureComponent {
    render() {
        return (
            <div>
                <div className="page-header">
                    <SearchBar/>
                </div>

                <Router>
                    <Navbar />
                    <Route exact path="/" component={App} />
                    <Route path="/info" component={Info} />
                    <Route path="/radar" component={RadarProfile} />
                </Router>
            </div>
        )
    }
}


ReactDOM.render(<MyApp />, document.getElementById('root'))


// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
